data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2527634","type":"CustomJS"},{"attributes":{},"id":"2527430","type":"BasicTicker"},{"attributes":{"coordinates":null,"data_source":{"id":"2527263"},"glyph":{"id":"2527502"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"2527504"},"nonselection_glyph":{"id":"2527503"},"view":{"id":"2527506"}},"id":"2527505","type":"GlyphRenderer"},{"attributes":{"active_drag":{"id":"2527287"},"active_scroll":{"id":"2527288"},"tools":[{"id":"2527287"},{"id":"2527288"},{"id":"2527289"},{"id":"2527290"},{"id":"2527291"},{"id":"2527292"},{"id":"2527293"},{"id":"2527316"},{"id":"2527635"}]},"id":"2527295","type":"Toolbar"},{"attributes":{"below":[{"id":"2527425"}],"center":[{"id":"2527428"},{"id":"2527432"},{"id":"2527449"}],"height":90,"left":[{"id":"2527429"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"2527454"},{"id":"2527460"}],"sizing_mode":"stretch_width","title":{"id":"2527667"},"toolbar":{"id":"2527441"},"toolbar_location":null,"width":null,"x_range":{"id":"2527230"},"x_scale":{"id":"2527421"},"y_range":{"id":"2527419"},"y_scale":{"id":"2527423"}},"id":"2527417","subtype":"Figure","type":"Plot"},{"attributes":{"fill_color":{"field":"returns_positive","transform":{"id":"2527266"}},"marker":{"value":"triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_long"}},"id":"2527451","type":"Scatter"},{"attributes":{},"id":"2527563","type":"LinearScale"},{"attributes":{"overlay":{"id":"2527294"}},"id":"2527289","type":"BoxZoomTool"},{"attributes":{"data":{
